  width: auto;
  background-color: white;
  color: #97999b;
  text-align: center;
  display: inline-block;
  border-radius: 3px;
  position: absolute;
  font-size: 0.83em;
  font-weight: normal;
  border: 1px rgb(0, 0, 0) solid;
  /* z-index: 200000; */
  z-index: 10;
  /* max-width: initial; */
  max-width: 274px;
  text-align: start;
  background-color: #fff;
  border: 1px solid rgba(0, 0, 0, 0.2);
  border-radius: 0.3rem;
  opacity: 0;
  transition: opacity 0.3s, visibility 0.3s;
  visibility: hidden;
}

.show.popover {
  z-index: 999;
  opacity: 1;
  visibility: visible;
}

.popover-body {
  color: #6c6e71;
}

.popover .popover_arrow {
  width: 0;
  height: 0;
  border-style: solid;
  position: absolute;
  margin: 6px;
  color: transparent;
}

.popover[x-placement^="top"] {
  margin-bottom: 15px;
}

.popover[x-placement^="top"] .popover_arrow {
  border-width: 8px 8px 0 8px;
  border-color: #d6d6d6 transparent transparent transparent;
  bottom: -8px;
  margin-bottom: 0;
}

.popover[x-placement^="top"] .popover_arrow::before {
  content: "";
  display: inline-block;
  position: absolute;
  left: -8px;
